import React from "react";
import "../App.css";

function Search() {
    return (
        <div>
            <form>
                <input
                    type="text"
                    name="query"
                    id="query"
                    placeholder="Search"
                ></input>
                <button type="submit" id="search-button">
                    Search
                </button>
            </form>
        </div>
    );
}

export default Search;
